import Card from './Card';

export default function Cards({characters}) {

   return (
   <div>
      {characters.map(({id, name, status, species, gender, image, origin}) =>(
      <Card
         key={id}
         name={name}
         status={status}
         species={species}
         gender={gender}
         origin={origin}
         image={image}
         onClose={() => window.alert('Emulamos que se cierra la card')}
      />
   ))}
   </div>
   )
}
